import styled from 'styled-components';

export const Wrapper = styled.div`
  display: block;
  width: 100%;
  color: white;
`;

export const SearchWrapper = styled.div`
  margin-top: 30vh;
  justify-content: center;
`;

export const SearchInput = styled.input`
  border-radius: 1rem;
  font-size: 4rem;
  background: grey;

  &&::placeholder {
    color: white;
  }
`;


export const ContentWrapper = styled.div`
  margin: 3rem;
  justify-content: center;
`;

export const ConstentBox = styled.div`
  margin: 1rem;
  padding: 1rem;
  background: grey;
  border-radius: 1rem;
  width: 30%;
`;
